import ProductSale from "../components/ProductSale";

const Featured = () => {
  const items = [
    {
      key: "img01",
      src: "../images/browitem.jpeg",
      price: "$25.00",
      alt: "Brow Gel",
    },
    {
      key: "img02",
      src: "../images/browset.jpeg",
      price: "$30.00",
      alt: "Brow Gel Set",
    },
  ];

  return (
    <section class="featured">
      <div class="featured-items">
        {items.map((a) => {
          return <ProductSale key={a.key} src={a.src} price={a.price} alt={a.alt}  class="grid-item" />;
        })}
      </div>
      <div class="featured-video">
        <iframe
          src="https://assets.pinterest.com/ext/embed.html?id=187040190766436100"
          height="714"
          width="345"
          frameborder="0"
          title="How to do your eyebrows"
        ></iframe>
      </div>
    </section>
  );
};

export default Featured;
